package com.brainstormers.justlearnit.models;import javax.persistence.*;import java.sql.Date;@Entity@Table(name = "person", schema = "public", catalog = "justlearnit")public class PersonEntity {    private int id;    private String firstName;    private String lastName;    private Date dateOfBirth;    private String password;    private String username;    private String email;    @Id    @Column(name = "id")    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    @Basic    @Column(name = "first_name")    public String getFirstName() {        return firstName;    }    public void setFirstName(String firstName) {        this.firstName = firstName;    }    @Basic    @Column(name = "last_name")    public String getLastName() {        return lastName;    }    public void setLastName(String lastName) {        this.lastName = lastName;    }    @Basic    @Column(name = "date_of_birth")    public Date getDateOfBirth() {        return dateOfBirth;    }    public void setDateOfBirth(Date dateOfBirth) {        this.dateOfBirth = dateOfBirth;    }    @Basic    @Column(name = "password")    public String getPassword() {        return password;    }    public void setPassword(String password) {        this.password = password;    }    @Basic    @Column(name = "username")    public String getUsername() {        return username;    }    public void setUsername(String username) {        this.username = username;    }    @Override    public boolean equals(Object o) {        if (this == o) return true;        if (o == null || getClass() != o.getClass()) return false;        PersonEntity that = (PersonEntity) o;        if (id != that.id) return false;        if (firstName != null ? !firstName.equals(that.firstName) : that.firstName != null) return false;        if (lastName != null ? !lastName.equals(that.lastName) : that.lastName != null) return false;        if (dateOfBirth != null ? !dateOfBirth.equals(that.dateOfBirth) : that.dateOfBirth != null) return false;        if (password != null ? !password.equals(that.password) : that.password != null) return false;        if (username != null ? !username.equals(that.username) : that.username != null) return false;        return true;    }    @Override    public int hashCode() {        int result = id;        result = 31 * result + (firstName != null ? firstName.hashCode() : 0);        result = 31 * result + (lastName != null ? lastName.hashCode() : 0);        result = 31 * result + (dateOfBirth != null ? dateOfBirth.hashCode() : 0);        result = 31 * result + (password != null ? password.hashCode() : 0);        result = 31 * result + (username != null ? username.hashCode() : 0);        return result;    }    @Basic    @Column(name = "email")    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }}